import {Link} from "react-router-dom";

export default function Header(){
    return(
        <div>
            <h1>Header</h1>
            <nav>
                <Link to="/">Main</Link> |{" "}
                <Link to="/1">Homework 1</Link> |{" "}
                <Link to="/2">Homework 2</Link> |{" "}
                <Link to="/3">Homework 3</Link>
            </nav>
        </div>
    )
}
